import base64
from PIL import Image
from io import BytesIO

# Contoh Base64 string dari gambar yang valid
base64_string = """

"""

# Menghapus karakter newline (jika ada) dan spasi dari string Base64
base64_string = base64_string.replace("\n", "").replace(" ", "")

# Mendekode string Base64 menjadi gambar
image_data = base64.b64decode(base64_string)
image = Image.open(BytesIO(image_data))

# Menampilkan gambar
image.show()
